INSERT INTO investment_firms (id, name, description, website, location, stages, sectors, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, firm_classification, enrichment_status) VALUES ('f77dd1f6-63f8-4362-baf1-590fcae8649e', 'Deeptech Seed Fund', 'Deeptech.eu is a venture capital firm focused on European deeptech startups showing early signs of global market potential. They invest in companies across various sectors, excluding life sciences, that have initial customer traction. The firm''s unique approach involves validating opportunities through customer feedback and consulting with international later-stage investors to ensure promising ventures receive appropriate funding from the start. This strategy helps Deeptech.eu make informed investment decisions and addresses the challenge many deeptech startups face in finding investors who understand their complex propositions.. DeepTech focused. Fund size: â‚¬70M', 'https://www.deeptechseedfund.com/', 'Europe', '["Pre-seed","Seed"]'::jsonb, '["AI/ML","Cleantech","Energy","Materials","Mobility"]'::jsonb, '2025-12-25T17:37:11.685Z', 'com_272921b4-0f60-4a35-a63f-db64a9355422', 'grp_aa703c07-2212-4f88-b0ac-19d79adbbf2b', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_aa703c07-2212-4f88-b0ac-19d79adbbf2b","grp_b6775cbc-29e9-4e71-b742-e0498331dee8","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T19:20:33.916Z', 'folk', '2025-12-25T19:20:33.918Z', 'Ireland', 'AI/ML, Cleantech, Energy, Materials, Mobility', '[]'::jsonb, '[]'::jsonb, '[]'::jsonb, '["https://www.deeptechseedfund.com/","https://deeptechseedfund.com"]'::jsonb, '{"dtOnly":"Yes","dtDeals":"--","fundSize":"â‚¬70M","maxTicket":"$500K","minTicket":"$50K","rawStages":["Pre-seed","Seed"],"rawLocations":["Europe"],"parentCompany":null,"rawIndustries":["AI/ML","Cleantech","Energy","Materials","Mobility"]}'::jsonb, 'Venture Capital', 'n