INSERT INTO investment_firms (id, name, description, website, location, stages, sectors, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, firm_classification, enrichment_status) VALUES ('ea25d0a1-f66c-4b00-ac17-aa86424e98d9', 'Exceptional Ventures', 'Exceptional Ventures, we are a London-based venture capital firm dedicated to investing in high-impact startups that contribute to improving the world we live in. Our mission is clear: we aim to help people live healthier, happier, and longer lives while promoting a sustainable planetary ecosystem. Through our debut fund, EV Fund 1, which targets £20 million in size, we are actively building a portfolio of 40 early-stage startups over the next three years. Our focus areas include HealthTech, FoodTech, and Financial Health, primarily within the UK/EU region while opportunistically exploring opportunities globally. Our founders, Matt Cooper and Paolo Pio, bring a wealth of experience to Exceptional Ventures. Matt''s background includes co-founding Capital One Bank in the US, Tandem Bank in the UK, and chairing Octopus Group for over two decades. Paolo, formerly a Silicon Valley Software Engineer and Tech Executive, transitioned into venture capital as MD Europe at Joyance Partners, a prominent US HealthTech VC fund. With a combined portfolio of over 200 invested startups, we leverage our deep industry knowledge and extensive network to support entrepreneurs and drive positive societal impact through strategic investments.. DeepTech deals: 5-Jan. Fund size: Â£20M', 'https://exceptional.ventures/', 'Asia, Canada, Europe, Israel, Worldwide', '["Pre-seed","Seed"]'::jsonb, '["Food & Ag","Healthtech"]'::jsonb, '2025-12-25T18:32:15.552Z', 'com_3171e3f3-e8b9-44ca-a331-4bd2819bfa8e', 'grp_aa703c07-2212-4f88-b0ac-19d79adbbf2b', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_aa703c07-2212-4f88-b0ac-19d79adbbf2b",